import React, { Component } from "react";
import axios from "axios";

class MyComponent extends React.Component {
  state = {
    redirect: false
  }
  setRedirect = () => {
    this.setState({
      redirect: true
    })
  }
  renderRedirect = () => {
    if (this.state.redirect) {
      return <Redirect to='/components/RegisterCandidate' />
    }
  }
  render () {
    return (
       <div>
        {this.renderRedirect()}
        <button onClick={this.setRedirect}>Partner Registration</button>
       </div>
    )
  }
}
class User extends Component {
  constructor(props, context) {
    super(props, context);

    this.state = {
      userName: "",
      name: "",
      location: "",
      email: "",
      password: "",
      age: "",
      phoneNumber: "",
      userType:  "",
      skills: "",
      interests: "",
      pastEventsAndTasks: "",
      reviewsRecieved: "",
      board: "",
      pastEvents: "",
      reports: "",
      organisationName: "",
      businessPartners: "",
      eventsOrganized: "",
      fieldOfWork:"",
      projectHistory: ""
    };
  }

  handleChangeUserName = user => {
    this.setState({ userName: user.target.value });
  };

  handleChangeName = user => {
    this.setState({ name: user.target.value });
  };

  handleChangeLocation = user => {
    this.setState({ location: user.target.value });
  };

  handleChangeEmail = user => {
    this.setState({ email: user.target.value });
  };

  handleChangePassword  = user => {
    this.setState({ password: user.target.value });
  };

  handleChangeAge = user => {
    this.setState({ age: user.target.value });
  };

  handleChangePhoneNumber = user => {
    this.setState({ phoneNumber: user.target.value });
  };

  handleChangeUserType = user => {
    this.setState({ userTSype: user.target.value });
  };
  handleChangeSkills = user => {
    this.setState({ skills: user.target.value });
  };

  handleChangeIntrests = user => {
    this.setState({ interests: user.target.value });
  };

  handleChangePastEventsAndTasks = user => {
    this.setState({ pastEventsAndTasks: user.target.value });
  };

  handleChangeReviewsRecived = user => {
    this.setState({ reviewsRecieved: user.target.value });
  };

  handleChangeBoard  = user => {
    this.setState({ board: user.target.value });
  };

  handleChangePastEvents = user => {
    this.setState({ pastEvents: user.target.value });
  };

  handleChangeReports = user => {
    this.setState({ reports: user.target.value });
  };

  handleChangeOrganizationName = user => {
    this.setState({ organisationName: user.target.value });
  };
  handleChangeBusinessPartners  = user => {
    this.setState({ businessPartners: user.target.value });
  };

  handleChangeEventsOrganized = user => {
    this.setState({ eventsOrganized: user.target.value });
  };

  handleChangeFieldOfWork = user => {
    this.setState({ fieldOfWork: user.target.value });
  };

  handleChangeProjectHistory = user => {
    this.setState({ projectHistory: user.target.value });
  };

 
  handleSubmit = async event => {
    event.preventDefault();

    const user = {
      userName: this.state.userName,
      name: this.state.name,
      location: this.state.location,
      password: this.state.password,
      email: this.state.email,
      age: this.state.age,
      phoneNumber: this.state.phoneNumber,
      userType: this.state.userType,
      skills: this.state.skills,
      interests: this.state.interests,
      pastEventsAndTasks: this.state.pastEventsAndTasks,
      reviewsRecieved: this.state.reviewsRecieved,
      board: this.state.board,
      pastEvents: this.state.pastEvents,
      reports: this.state.reports,
      organisationName: this.state.organisationName,
      businessPartners: this.state.businessPartners,
      eventsOrganized: this.state.eventsOrganized,
      fieldOfWork:this.state.fieldOfWork,
      projectHistory: this.state.projectHistory
     };
    console.log(user);
    try {
      let response= await axios.post("http://localhost:3001/Routes/api/users/", user);
      console.log(response);
    } 
    catch(error) {
      console.log(error);
    }
  };
  
  render(){
      return(
        
          <div className= "user">
          <h1> users </h1>
          <form onSubmit={this.handleSubmit}>
          <label className= "userName">
            userName:
          <input
          onChange ={this.handleChangeUserName}
          type="text"
          name= "userName"
          />
        </label>
        <label className= "Name">
            Name:
            <input
            onChange = {this.handleChangeName}
            type="text"
            name="name"
            />
        </label>
        <label className= "Email">
            Email:
            <input
            onChange={this.handleChangeEmail}
            type="text"
            name="email"
            />
        </label>
        <label className= "Age">
            Age:
            <input
            onChange = {this.handleChangeAge}
            type="number"
            name="age"
            />
        </label>
        <label className= "Password">
            Password:
            <input
            onChange = {this.handleChangePassword}
            type="text"
            name="Password"
            />
        </label>
        <label className= "Phonenumber">
            Phonenumber:
            <input
            onChange = {this.handleChangePhoneNumber}
            type="number"
            name="phoneNumber"
            />
        </label>
        <label className= "userType">
            Usertype:
            <input
            onChange ={this.handleChangeUserType}
            type="text"
            name="userType"
            />
        </label>
        <label className= "location">
            location:
            <input
            onChange={this.handleChangeLocation}
            type="text"
            name="location"
            />
        </label>
        <button type = "submit" onClick={this.handleSubmit}> Create user </button>
        </form>

      
        </div>
      );
      
  }
}
export default User;
